import { assertEquals } from "https://deno.land/std/testing/asserts.ts";

function maximumScore(nums: number[], k: number): number {
    const m = Array(nums.length);
    m[k] = nums[k];
    for (let i = k - 1; i >= 0; i--) {
        m[i] = Math.min(m[i + 1], nums[i]);
    }
    for (let j = k + 1; j < nums.length; j++) {
        m[j] = Math.min(m[j - 1], nums[j]);
    }

    let maxScore = nums[k];
    for (let i = k; i >= 0; i--) {
        // if (maxScore > Math.min(m[i], m[k]) * nums.length) break;
        for (let j = k; j < nums.length; j++) {
            const min = Math.min(m[i], m[j]);
            if (maxScore > min * nums.length) break;
            const score = min * (j - i + 1);
            maxScore = Math.max(maxScore, score);
        }
    }
    return maxScore;
}

Deno.test("test", () => {
    const nums = [1, 4, 3, 7, 4, 5]
    const k = 3
    assertEquals(maximumScore(nums, k), 15);
})
Deno.test("test", () => {
    const nums = [5, 5, 4, 5, 4, 1, 1, 1]
    const k = 0
    assertEquals(maximumScore(nums, k), 20);
})

